import React from 'react';

const TodoList = () =>{
    return (
        <>
        <div className='main_div'>
            <div className='center_div'>
                <br />
                <h1>To Do List</h1>
                <br />
                <input  type="text" placeholder="Add a Items" />
            </div>
        </div>
        </>
    )
}


export default TodoList;
